import { stevieQuotes } from "./stevie.js";

function newQuote() {
  var randomNumber = Math.floor(Math.random() * stevieQuotes.length);
  document.getElementById("quoteDisplay").innerHTML =
    stevieQuotes[randomNumber];
}
